import React from 'react'
import LinkCard from './LinkCard'

const DisplayLinks = ({links}) => {
    return(
        <div className="display-links">
            <ul>
                {   links.map((link, i) => <li key={i}><LinkCard link={link} /></li>) }
            </ul>
        </div>
    )
}

export default DisplayLinks
